import React, { useState, useEffect } from 'react';
// import logo from './logo.svg';
import './App.css';



function App() {


  useEffect(() => {
    fetch('/users')
      .then(res => res.json())
      .then(users => this.setState({ users }));
  });

  return (
    <div className="App">
      <h1>Users</h1>
      <ul>
        {this.state.users.map(user  =>
        <li key = {user.id}>{user.username}</li>)}
      </ul>
    </div>
  )
}

export default App;
